        //     var objbuilder = '';
        //     objbuilder += ('<object width="100%" height="100%"      data="data:image/jpeg;base64,');
        //     objbuilder += (base64PDF);
        //    objbuilder += ('" type="image/jpeg" class="internal">');
        //     objbuilder += ('<embed src="data:image/jpeg;base64,');
